import React, { Component } from 'react';
import { BarChart, Bar } from 'recharts';
import { LineChart, Line, CartesianGrid, XAxis, YAxis } from 'recharts';

class TopEmployees extends Component {
    constructor(props) {
        super(props)
        this.state = {
            topEmployees: [{ name: "Jorge", sales: 40 }, { name: "Maria", sales: 20 }, { name: "Laura", sales: 50 }]
        }

    }


    render() {

        const renderLineChart = (
            <BarChart width={600} height={300} data={this.state.topEmployees}>
                <Bar type="monotone" dataKey="sales" stroke="#8884d8" />
                <CartesianGrid stroke="#ccc" />
                <XAxis dataKey="sales"/>
                <YAxis dataKey="name"/>
            </BarChart>)


        return (<div>
            {renderLineChart}
        </div>)
    }
}
export default TopEmployees;
